class Queue:
    def __init__(self):
        self.s1 = []
        self.s2 = []

    def enqueue(self, item):
        self.s1.append(item)

    def dequeue(self):
        if not self.s2:
            while self.s1:
                self.s2.append(self.s1.pop())
            # Now s2 has the first element to be dequeued
            if not self.s2:
                raise Exception("Queue is empty")
            return self.s2.pop()
        else:
            return self.s2.pop()

    def peek(self):
        if not self.s2:
            while self.s1:
                self.s2.append(self.s1.pop())
        return self.s2[-1]

    def is_empty(self):
        return not bool(self.s1) and not bool(self.s2)

